"use strict";class GetterSetterParameters{constructor(e){this.elem=e}get Height(){if(this.elem)return parseFloat(this.elem.clientHeight)}set Height(e){this.elem&&("number"!=typeof e||isNaN(e)?"string"==typeof e&&(this.elem.style.height=e):this.elem.style.height=e+"px")}get Width(){if(this.elem)return parseFloat(this.elem.clientWidth)}set Width(e){this.elem&&("number"!=typeof e||isNaN(e)?"string"==typeof e&&(this.elem.style.width=e):this.elem.style.width=e+"px")}replaceAll(e,t,i){return e.split(t).join(i)}}